Select adalah perintah SQL yang digunakan untuk mengambil data dari tabel database. Perintah ini digunakan untuk mengambil data yang ditentukan dari tabel database.

Contoh Select:
1. SELECT * FROM tabel_nama;
2. SELECT nama, alamat FROM tabel_nama;
3. SELECT * FROM tabel_nama WHERE nama='John';
4. SELECT * FROM tabel_nama WHERE alamat LIKE '%Jakarta%';
5. SELECT * FROM tabel_nama ORDER BY nama ASC;

Rollback adalah proses mengembalikan data ke versi sebelumnya. Ini digunakan untuk membatalkan perubahan yang telah dibuat pada data. Rollback dapat digunakan untuk mengembalikan data ke versi sebelumnya jika terjadi kesalahan atau masalah.

Contoh Syntax Rollback
1. ROLLBACK TRANSACTION;
2. ROLLBACK TRANSACTION NamaTransaksi;
3. ROLLBACK WORK;
4. ROLLBACK WORK TO NamaTransaksi;
5. ROLLBACK WORK TO SAVEPOINT NamaSavepoint;
